// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

interface ISyndicateClosedEndFundDistributionLogicV0 {
    function managerSetDistributions(
        address syndicateAddress,
        address[] calldata distributionERC20Addresses,
        uint256[] calldata amounts
    ) external;

    function managerSetDistributionsClaimedForMembers(
        address syndicateAddress,
        address[] calldata distributionERC20Addresses,
        address[] calldata memberAddresses,
        uint256[] calldata amounts
    ) external;

    function memberClaimDistributions(
        address syndicateAddress,
        address[] calldata ERC20Addresses,
        uint256[] calldata amounts
    ) external;

    function getDistributionTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) external returns (uint256);

    function getDistributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress
    ) external returns (uint256);

    function getDistributionUnclaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress
    ) external returns (uint256);

    function getDistributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) external returns (uint256);

    function calculateEligibleDistribution(
        uint256 depositMember,
        uint256 depositTotal,
        uint256 distributionClaimedMember,
        uint256 distributionTotal
    ) external returns (uint256);

    function calculateDistributionShares(
        uint256 amount,
        uint256 syndicateDistributionShareBasisPoints,
        uint256 managerDistributionShareBasisPoints
    )
        external
        returns (
            uint256,
            uint256,
            uint256
        );
}
